import React from "react";
import "../styles/Learn.css";

function Learn() {
    return (
        <div className="learn">
            <h1>Learn About Climate Change</h1>
            <p>Educate yourself about the causes and effects of climate change, and learn ways to help mitigate it.</p>
            <ul>
                <li>What is Climate Change?</li>
                <li>Impact of Climate Change on Ecosystems</li>
                <li>How to Reduce Your Carbon Footprint</li>
                <li>Climate Change and Its Impact on Human Health</li>
            </ul>
        </div>
    );
}

export default Learn;
